import React from "react";

const Content = () => {
  let todoList = [
    {
      id: 1,
      title: "Learn React",
      completed: false,
    },
    {
      id: 2,
      title: "Learn AI",
      completed: true,
    },
    {
      id: 3,
      title: "Learn Angular",
      completed: false,
    },
    {
      id: 3,
      title: "Learn Node",
      completed: true,
    },
  ];
  return (
    <main>
      <ul>
        {todoList.map((todo) => (
            <li className="item">
                <input type="checkbox" checked={todo.completed} />
                <label htmlFor="">{todo.title}</label>
                <button>Delete</button>
            </li>
        ))}
      </ul>
    </main>
  );
};

export default Content;
